import React, { useState, useEffect } from "react";
import Slider from "react-slick";
import Confetti from "react-confetti";
import "./App.css";

// Sample photos - replace with your own URLs or import local images
const photos = [
  "https://images.unsplash.com/photo-1508214751196-bcfd4ca60f91?auto=format&fit=crop&w=800&q=80",
  "https://images.unsplash.com/photo-1524504388940-b1c1722653e1?auto=format&fit=crop&w=800&q=80",
  "https://images.unsplash.com/photo-1508214751196-bcfd4ca60f91?auto=format&fit=crop&w=800&q=80",
  "https://images.unsplash.com/photo-1517841905240-472988babdf9?auto=format&fit=crop&w=800&q=80",
];

const birthdayDate = new Date("2025-05-15T00:00:00"); // Set her birthday here (YYYY-MM-DD)

function App() {
  const [timeLeft, setTimeLeft] = useState(getTimeLeft());
  const [isBirthday, setIsBirthday] = useState(false);
  const [windowSize, setWindowSize] = useState({ width: window.innerWidth, height: window.innerHeight });

  function getTimeLeft() {
    const now = new Date();
    let diff = birthdayDate - now;

    if (diff <= 0) {
      return null;
    }

    const days = Math.floor(diff / (1000 * 60 * 60 * 24));
    diff -= days * (1000 * 60 * 60 * 24);
    const hours = Math.floor(diff / (1000 * 60 * 60));
    diff -= hours * (1000 * 60 * 60);
    const minutes = Math.floor(diff / (1000 * 60));
    diff -= minutes * (1000 * 60);
    const seconds = Math.floor(diff / 1000);

    return { days, hours, minutes, seconds };
  }

  useEffect(() => {
    // Update countdown every second
    const timer = setInterval(() => {
      const left = getTimeLeft();
      setTimeLeft(left);
      if (!left) {
        setIsBirthday(true);
      }
    }, 1000);

    // Update window size for confetti
    const handleResize = () => setWindowSize({ width: window.innerWidth, height: window.innerHeight });
    window.addEventListener("resize", handleResize);

    return () => {
      clearInterval(timer);
      window.removeEventListener("resize", handleResize);
    };
  }, []);

  const sliderSettings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 4000,
    arrows: true,
  };

  return (
    <div className="App">
      {isBirthday && <Confetti width={windowSize.width} height={windowSize.height} />}
      <header className="App-header">
        <h1>Happy Birthday, Beautiful!</h1>
        {!isBirthday && timeLeft && (
          <div className="countdown">
            <p>Countdown to your special day:</p>
            <div className="time">
              <div><span>{timeLeft.days}</span>Days</div>
              <div><span>{timeLeft.hours}</span>Hours</div>
              <div><span>{timeLeft.minutes}</span>Minutes</div>
              <div><span>{timeLeft.seconds}</span>Seconds</div>
            </div>
          </div>
        )}
        {isBirthday && (
          <div className="birthday-message">
            <h2>üéâ Today is your day! üéâ</h2>
            <p>Wishing you all the happiness and love in the world. Enjoy your birthday! üíñ</p>
          </div>
        )}
      </header>

      <section className="photo-slider">
        <Slider {...sliderSettings}>
          {photos.map((url, index) => (
            <div key={index} className="slide">
              <img src={url} alt={`Birthday photo ${index + 1}`} />
            </div>
          ))}
        </Slider>
      </section>

      <footer>
        <p>Made with ‚ù§Ô∏è just for you.</p>
      </footer>
    </div>
  );
}

export default App;
